    false,nt"url": null,nt"notes": "This narrative report for Missisquoi NWR
    outlines Refuge accomplishments from September through December of 1954. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and vegetation
    control. Resource management is outlined; topics include fur harvesting and timber
    removal. A progress report on field investigations and applied research is also
    provided. The public relations section of the report describes recreational uses,
    Refuge visitors, hunting, and fishing. N-R forms and photographs are attached.",nt"owner_org":
